('0832664d-c5ad-405c-8fc3-72d2f94c46e3', N'Kỹ năng sử dụng phần mềm quản lý', N'Sử dụng phần mềm để theo dõi và quản lý công việc.', 'Moving'),
('5fbc1308-e096-4f73-9c7a-9bee9eaa238f', N'Kỹ năng pháp lý', N'Hiểu biết về các quy định pháp lý liên quan đến việc di chuyển.', 'Moving'),
('a55a9bc9-1387-4b8d-8124-30bef2a67810', N'Kỹ năng chăm sóc khách hàng', N'Cung cấp dịch vụ chăm sóc khách hàng xuất sắc.', 'Moving'),
('2d8c2252-5abb-4076-9377-68b9b3dcc5f7', N'Kỹ năng phòng chống hỏa hoạn', N'Biết cách phòng chống và xử lý tình huống hỏa hoạn.', 'Moving'),
('ccd0125f-e74f-4376-a53a-b38bf8f9726b', N'Kỹ năng sử dụng thiết bị nâng đỡ', N'Sử dụng các thiết bị như xe nâng, palet jack.', 'Moving'),
('d5d68a28-28b4-40b9-a575-a3579d72731c', N'Kỹ năng tiết kiệm năng lượng', N'Sử dụng phương tiện và thiết bị một cách tiết kiệm năng lượng.', 'Moving'),
('61cadec3-d77b-422c-9ab4-04bc2e150b09', N'Kỹ năng bảo quản đồ vật nghệ thuật', N'Bảo quản và di chuyển đồ vật nghệ thuật một cách cẩn thận.', 'Moving'),
('a7f74db4-0fed-4c84-b64e-0e39c972415d', N'Kỹ năng sử dụng thiết bị định vị', N'Sử dụng thiết bị định vị để theo dõi hàng hóa.', 'Moving'),
('e2de60c6-21eb-405f-906c-8b985806833f', N'Kỹ năng quản lý chi phí', N'Quản lý chi phí và ngân sách cho các dự án di chuyển.', 'Moving'),
('1a326688-fb2a-4331-8947-0721f897bdf1', N'Kỹ năng phản ứng nhanh', N'Phản ứng nhanh chóng với các thay đổi và yêu cầu của khách hàng.', 'Moving'),
('c0b63f38-b570-4e4f-bf73-aa11eae58738', N'Đóng gói và vận chuyển đồ vật nhạy cảm', N'Kỹ năng đóng gói và vận chuyển các đồ vật nhạy cảm như nhạc cụ, tác phẩm nghệ thuật một cách cẩn thận và an toàn.', 'Moving'),
('085ba927-ab37-48ac-a48a-1559dd922ef6', N'Vận hành thiết bị điện tử', N'Có khả năng vận hành và sử dụng các thiết bị điện tử một cách chính xác và hiệu quả, bao gồm cả việc thiết lập và điều chỉnh các chế độ hoạt động.', 'ElectronicCleaning'),
('8b962905-e009-479b-bf8e-ce293c9a8f3a', N'Chuẩn đoán sự cố và sửa chữa', N'Có khả năng phát hiện và chuẩn đoán các sự cố phổ biến trên các thiết bị điện tử, sau đó thực hiện các biện pháp sửa chữa cần thiết để khắc phục vấn đề.', 'ElectronicCleaning'),
('d1e6097d-3997-4fee-8725-ab5d4461a898', N'Tháo lắp và lắp ráp thiết bị', N'Có khả năng tháo lắp các bộ phận của các thiết bị điện tử để tiến hành quá trình vệ sinh và bảo dưỡng, sau đó lắp ráp lại chúng một cách chính xác.', 'ElectronicCleaning'),
('998c3aca-cceb-4ba0-85be-a6d613e58d0a', N'Kiểm tra và đánh giá hiệu suất hoạt động', N'Có khả năng kiểm tra và đánh giá hiệu suất hoạt động của các thiết bị điện tử sau khi thực hiện quá trình vệ sinh và bảo dưỡng.', 'ElectronicCleaning'),
('0640c2f3-935a-4226-a65f-748b7d718873', N'Sử dụng công cụ và thiết bị hỗ trợ', N'Sử dụng một loạt các công cụ và thiết bị hỗ trợ như máy hút bụi, máy làm sạch bằng hơi nước, bàn là hơi nước và các thiết bị khác để tiến hành quá trình vệ sinh.', 'ElectronicCleaning'),
('4f296d49-c1a1-482f-9bb1-718358d88649', N'Kiến thức về phần mềm và firmware', N'Hiểu biết về các phần mềm và firmware cần thiết để thực hiện việc kiểm tra, chuẩn đoán và sửa chữa các thiết bị điện tử.', 'ElectronicCleaning'),
('76aac10f-973d-4092-8133-47c2502668a5', N'Thử nghiệm và kiểm tra chất lượng', N'Thực hiện các quy trình thử nghiệm và kiểm tra chất lượng để đảm bảo rằng các thiết bị đã được vệ sinh hoàn chỉnh và hoạt động một cách đúng đắn.', 'ElectronicCleaning'),
('eb56148b-27e0-43ee-8aaa-6873703361e5', N'Sử dụng dung dịch vệ sinh', N'Hiểu biết về các loại dung dịch vệ sinh phù hợp với từng loại thiết bị.', 'ElectronicCleaning'),
('7c13b351-2348-4c56-b267-e6e37aca1910', N'Tháo lắp thiết bị', N'Khả năng tháo lắp các thiết bị điện tử một cách cẩn thận và chính xác.', 'ElectronicCleaning'),
('c1f69565-ded5-4f16-859d-f47ee45f9a06', N'Sử dụng dụng cụ vệ sinh', N'Sử dụng thành thạo các dụng cụ vệ sinh chuyên dụng như cọ, khăn lau, bàn chải.', 'ElectronicCleaning'),
('5bd5ae7d-e422-4083-9cc2-1a4a93ea7146', N'Phân loại rác thải điện tử', N'Phân loại và xử lý rác thải điện tử theo quy định.', 'ElectronicCleaning'),
('18fa1913-288b-48b7-b4e0-a1b26dbb1876', N'Kiểm tra chức năng', N'Kiểm tra chức năng của thiết bị sau khi vệ sinh để đảm bảo hoạt động bình thường.', 'ElectronicCleaning'),
('2651617c-19d9-4692-b16a-da35a5411479', N'An toàn điện', N'Hiểu biết về an toàn điện và cách xử lý các tình huống có nguy cơ gây giật điện.', 'ElectronicCleaning'),
('b689840d-4dc9-4ea3-8f37-8f18d0326b54', N'Vệ sinh màn hình', N'Làm sạch màn hình các thiết bị mà không làm hỏng lớp phủ bảo vệ.', 'ElectronicCleaning'),
('8aad994e-a161-487e-9d81-30b32cc9ab14', N'Vệ sinh bàn phím', N'Làm sạch bàn phím mà không làm hỏng cơ cấu bên trong.', 'ElectronicCleaning'),
