('ad614d5f-5275-4aa4-8202-aeea1b182d70', N'Sử dụng máy hút bụi mini', N'Sử dụng máy hút bụi mini để làm sạch bụi bẩn trong các khe nhỏ.', 'ElectronicCleaning'),
