('7c5daa33-96a4-4abf-9804-82a4e2c51dc3', N'Vệ sinh thiết bị chơi game', N'Làm sạch các console và phụ kiện gaming mà không làm hỏng chức năng.', 'ElectronicCleaning'),
('2a3bb015-abb5-42c0-82e4-ca67306328fc', N'Vệ sinh tủ lạnh', N'Làm sạch tủ lạnh mà không làm hỏng hệ thống làm lạnh.', 'ElectronicCleaning'),
('e13f143f-1961-4c25-8e95-b02544422a79', N'Vệ sinh máy giặt', N'Làm sạch máy giặt mà không làm hỏng cơ cấu hoặc hệ thống điều khiển.', 'ElectronicCleaning'),
('1292b66d-7000-4758-8d04-5d00e0f1aa5f', N'Vệ sinh lò vi sóng', N'Làm sạch lò vi sóng mà không làm hỏng cơ cấu quay hoặc hệ thống điện tử.', 'ElectronicCleaning'),
('cbe8e1c6-3d05-49e3-a389-6cd7cabd708b', N'Vệ sinh máy hút bụi', N'Làm sạch máy hút bụi mà không làm hỏng động cơ hoặc hệ thống lọc.', 'ElectronicCleaning'),
('776ae29f-6174-4876-b4db-eeb908d8acf5', N'Vệ sinh thiết bị điều hòa không khí', N'Làm sạch điều hòa không khí mà không làm hỏng cảm biến hoặc hệ thống làm lạnh.', 'ElectronicCleaning'),
('8ea41ed1-5b69-46ae-8add-1bc93c05c5db', N'Vệ sinh máy hút ẩm', N'Làm sạch máy hút ẩm mà không làm hỏng hệ thống lọc hoặc cảm biến.', 'ElectronicCleaning'),
('f488cf4c-7d25-47d4-9c2a-7099a2f2a1fc', N'Vệ sinh thiết bị khác', N'Làm sạch các thiết bị điện tử khác theo yêu cầu của khách hàng.', 'ElectronicCleaning'),
